import React,{useEffect,useState} from 'react';
import helpers from '../../helpers/helper';
import axios from 'axios';

  const AdminDashboard = () =>  {
	const [users,setUsers] = useState([]);
	const token = localStorage.getItem('token');
	const userInfo = localStorage.getItem('user');
	const header = {Authorization : `Bearer ${token}`};

	useEffect (()=>{
		axios.get(`${process.env.REACT_APP_ADMIN_BASE_URL}/all-users`,{headers : header})
		.then((response)=>{
			setUsers(response.data.users);
		}).catch((error)=>{
			console.log(error);
		});
	},[]);
	return (
	  <div>
		welcome {helpers.decryption(userInfo)?.name}
			{
				users?.length>0 ?
					<div className='container'>
						<div className='row'>
							<div className='col-md-3'>Name</div>
							<div className='col-md-3'>Email</div>
							<div className='col-md-3'>Created At</div>
						</div>
						{
							// users?.map(function(value,index){
							// 	<div className='row'>
							// 		 <div className='col-md-3'>{value?.name}</div>
							// 			<div className='col-md-3'>{value?.email}</div>
							// 			<div className='col-md-3'>{value?.createdAt}</div>
							// 	</div>
  							// })
							<div className='col-md-3'>{users[0]?.name}</div>
						}
					</div>
				: null
			}
	  </div>
	);
  }

  export default AdminDashboard;
